def binary_to_decimal(binary):
    """Converts a binary number to its decimal equivalent.

    Args:
        binary: A string representing the binary number.

    Returns:
        The decimal equivalent of the binary number, or -1 if the input is invalid.
    """
    try:
        decimal = 0
        power = 0
        for digit in reversed(binary):
            if digit == '0':
                pass
            elif digit == '1':
                decimal += 2**power
            else:
                return -1  # Invalid binary digit
            power += 1
        return decimal
    except:
        return -1
