    """Given a list of integers, find the division of first even and odd number of a given list.
    For example:
    div_even_odd([1,2,3,4,5]) == 2.0
    div_even_odd([2,4,6,8]) == 2.0
    div_even_odd([1,3,5,7]) == 1.0
    """
