def find_Sum(arr,n):
    """
    Given an array of integers, find the sum of repeated elements in the array.
    For example:
    find_Sum([1,2,3,4,5,6,1,2,3], 9) == 12
    find_Sum([1,1,1,1,1], 5) == 4
    find_Sum([1,2,3,4,5], 5) == 0
    """
    counts = {}
    repeated_sum = 0
    for num in arr:
        if num in counts:
            counts[num] += 1
        else:
            counts[num] = 1
    for num, count in counts.items():
        if count > 1:
            repeated_sum += num * (count - 1)
    return repeated_sum
```

