def max_len_sub( arr, n):
    """
    Given an array arr[] of size n, find the maximum length of the subsequence with difference between adjacent elements for the given array.
    For example:
    max_len_sub([1, 2, 3, 4, 5], 5) == 5
    max_len_sub([1, 5, 2, 8, 3], 5) == 3
    """
    if n == 0:
        return 0
    dp = [1] * n
    for i in range(1, n):
        for j in range(i):
            if abs(arr[i] - arr[j]) <= 1:
                dp[i] = max(dp[i], dp[j] + 1)
    return max(dp)
```

