def count_Substrings(s,n):
    """
    Given a string s and an integer n, count the number of substrings of s that have the sum of digits equal to their length.
    For example:
    count_Substrings("121", 1) == 2
    count_Substrings("0011", 2) == 1
    """
    count = 0
    for i in range(len(s)):
        for j in range(i, len(s)):
            sub = s[i:j+1]
            digit_sum = 0
            for digit in sub:
                if digit.isdigit():
                    digit_sum += int(digit)
            if digit_sum == len(sub):
                count += 1
    return count
```

