def eulerian_num(n, m):
    """
    Finds the Eulerian number a(n, m).

    Args:
        n: The number of nodes.
        m: The number of edges.

    Returns:
        The Eulerian number a(n, m).
    """
    if n == 0:
        return 1
    if n == 1:
        return 1
    if m == 0:
        return 1
    if n == 2 and m == 1:
        return 1
    if n == 2 and m == 2:
        return 2
    if n == 3 and m == 1:
        return 3
    if n == 3 and m == 2:
        return 6
    if n == 3 and m == 3:
        return 11

    a = [0] * (n + 1)
    a[0] = 1
    a[1] = 1

    for i in range(2, n + 1):
        for j in range(i):
            a[i] += (-1)**j * (comb(i - 1, j) * a[j])

    return a[n]

def comb(n, k):
    """
    Calculates the binomial coefficient "n choose k".
    """
    if k < 0 or k > n:
        return 0
    if k == 0 or k == n:
        return 1
    if k > n // 2:
        k = n - k

    result = 1
    for i in range(k):
        result = result * (n - i) // (i + 1)
    return result
