def check_triplet(A, n, sum, count):
    """
    Given an array A of n integers and an integer sum,
    find the number of triplets in A such that the sum of the triplet is equal to sum.
    """
    count = 0
    for i in range(n - 2):
        for j in range(i + 1, n - 1):
            for k in range(j + 1, n):
                if A[i] + A[j] + A[k] == sum:
                    count += 1
    return count
