def smartNumber(n):
    """
    A smart number is a positive integer that is either a prime number or a
    product of distinct primes.
    Given a positive integer n, find the n-th smart number.
    For example:
    smartNumber(1) == 2
    smartNumber(2) == 29
    smartNumber(3) == 41
    """
    def is_prime(n):
        if n <= 1:
            return False
        for i in range(2, int(n**0.5) + 1):
            if n % i == 0:
                return False
        return True

    def is_smart(n):
        if is_prime(n):
            return True
        factors = []
        temp = n
        i = 2
        while i * i <= temp:
            if temp % i == 0:
                if is_prime(i):
                    factors.append(i)
                    temp //= i
                else:
                    return False
            else:
                i += 1
        if temp > 1:
            if is_prime(temp):
                factors.append(temp)
            else:
                return False
        return len(factors) > 0

    count = 0
    num = 2
    while count < n:
        if is_smart(num):
            count += 1
        if count == n:
            return num
        num += 1
    return -1
