def longest_subseq_with_diff_one(arr, n):
    """
    Given an array arr[] of N integers, the task is to find the length of the longest subsequence
    such that the difference between adjacent elements is one.
    For example:
    longest_subseq_with_diff_one([1, 2, 3, 4, 5], 5) == 5
    longest_subseq_with_diff_one([1, 3, 5, 7, 9], 5) == 2
    longest_subseq_with_diff_one([1, 2, 3, 5, 6], 5) == 4
    """
    dp = {}
    for i in range(n):
        dp[arr[i]] = 1
    for i in range(n):
        if arr[i] - 1 in dp:
            dp[arr[i]] = max(dp[arr[i]], dp[arr[i] - 1] + 1)
    return max(dp.values())
