def does_Contain_B(a, b, c):
    """
    Given three integers a, b, and c, find whether the given number is present in the infinite sequence or not.
    The infinite sequence is defined as follows:
    The sequence is generated by the following rules:
    1. If n is even, then n+1 is the next number in the sequence.
    2. If n is odd, then n*n is the next number in the sequence.
    For example:
    does_Contain_B(3, 2, 5) == True
    does_Contain_B(2, 2, 3) == False
    does_Contain_B(1, 2, 1) == True
    """
    if a == b:
        return True
    if a == c:
        return True
    seen = {a}
    while True:
        if a == b or a == c:
            return True
        if a % 2 == 0:
            a = a + 1
        else:
            a = a * a
        if a in seen:
            return False
        seen.add(a)
