def min_Ops(arr,n,k):
    """
    You are given a string s, you can convert any letter to any other letter
    at cost cost[i]
    Return the minimum cost to convert the string to empty string.
    For example:
    min_Ops("abc",3,2) == 2
    min_Ops("abc",3,3) == 0
    min_Ops("abc",3,1) == 2
    """
    if k == 1:
        return n - 1
    if n == 1:
        return 0

    ans = float('inf')
    for i in range(1 << n):
        temp = []
        cost = 0
        for j in range(n):
            if (i >> j) & 1:
                temp.append(arr[j])
            else:
                cost += 1

        if len(set(temp)) == 1:
            ans = min(ans, cost)

    if ans == float('inf'):
        return n - 1
    else:
        return ans
```

