def areEquivalent(num1,num2):
    """Given two integers num1 and num2, return True if the sum of divisors of num1 is equal to the sum of divisors of num2. Otherwise, return False.
    For example:
    areEquivalent(6, 28) == True
    areEquivalent(12, 36) == True
    areEquivalent(10, 15) == False
    """
