def find_even_Pair(A,N):
    """Given a list A of N integers, find the number of pairs (i, j) such that i < j and A[i] XOR A[j] is even.
    """
    even = 0
    odd = 0
    for i in range(N):
        if A[i] % 2 == 0:
            even += 1
        else:
            odd += 1
    return even * (even - 1) // 2 + odd * (odd - 1) // 2
```

