def find_Min(arr,low,high):
    """
    Finds the minimum element in a sorted and rotated array.

    Args:
        arr: The sorted and rotated array.
        low: The starting index of the subarray.
        high: The ending index of the subarray.

    Returns:
        The minimum element in the subarray.
    """
    if low == high:
        return arr[low]

    if high == low + 1:
        return min(arr[low], arr[high])

    mid = (low + high) // 2

    if arr[mid] > arr[high]:
        return find_Min(arr, mid + 1, high)
    else:
        return find_Min(arr, low, mid)
