def lps(str):
    """
    Finds the longest palindromic subsequence in the given string.

    Args:
        str: The input string.

    Returns:
        The longest palindromic subsequence.
    """
    n = len(str)
    dp = [[0 for _ in range(n)] for _ in range(n)]

    for i in range(n):
        dp[i][i] = 1

    for cl in range(2, n + 1):
        for i in range(n - cl + 1):
            j = i + cl - 1
            if str[i] == str[j] and cl == 2:
                dp[i][j] = 2
            elif str[i] == str[j]:
                dp[i][j] = dp[i + 1][j - 1] + 2
            else:
                dp[i][j] = max(dp[i][j - 1], dp[i + 1][j])

    i = 0
    j = n - 1
    lps_str = ""

    while i <= j:
        if i == j:
            lps_str += str[i]
            break
        if str[i] == str[j]:
            lps_str = str[i] + lps_str + str[j]
            i += 1
            j -= 1
        else:
            if dp[i][j - 1] > dp[i + 1][j]:
                j -= 1
            else:
                i += 1

    return lps_str
