def find_star_num(n):
    """
    Finds the n'th star number.
    The n'th star number is the number of points needed to form a star with n points.
    For example, the 5th star number is 6, which is the number of points needed to form a star with 5 points.
    """
    if n == 1:
        return 1
    elif n == 2:
        return 3
    elif n == 3:
        return 6
    elif n == 4:
        return 10
    else:
        return (n * (n + 1) // 2) + 1
```

