def find_star_num(n):
    """
    Finds the n'th star number.
    The n'th star number is the number of points needed to form a star with n points.
    For example, the 5th star number is 61.
    """
    if n == 1:
        return 1
    elif n == 2:
        return 5
    elif n == 3:
        return 14
    elif n == 4:
        return 35
    elif n == 5:
        return 61
    else:
        return (n * (n + 1) * (2 * n + 1)) // 6
```

