def even_binomial_Coeff_Sum( n):
    """Given a non-negative integer n, find the sum of even index binomial coefficients from 0 to n.
    For example:
    even_binomial_Coeff_Sum(3) == 5
    even_binomial_Coeff_Sum(4) == 15
    even_binomial_Coeff_Sum(5) == 35
    """
    if n < 0:
        return 0

    sum_even = 0
    for i in range(n + 1):
        if i % 2 == 0:
            sum_even += binomial_coefficient(n, i)
    return sum_even

def binomial_coefficient(n, k):
    """Calculates the binomial coefficient (n choose k)."""
    if k < 0 or k > n:
        return 0
    if k == 0 or k == n:
        return 1
    if k > n // 2:
        k = n - k

    result = 1
    for i in range(k):
        result = result * (n - i) // (i + 1)
    return result
```

