def validate(n):
    """
    Given a non-negative integer n, return True if the frequency of each digit is less than or equal to the digit itself.
    For example:
    validate(123) == True
    validate(323) == False
    """
    digit_counts = {}
    for digit in str(n):
        digit = int(digit)
        if digit in digit_counts:
            digit_counts[digit] += 1
        else:
            digit_counts[digit] = 1
    for digit, count in digit_counts.items():
        if count > digit:
            return False
    return True
```

