def modular_inverse(arr, N, P):
    """
    Given an array arr[] of N integers, the task is to find the count of
    elements in arr[] which have modular inverse under given prime number p
    equal to itself.
    For example:
    modular_inverse([1, 2, 3, 4, 5], 10, 7) == 3
    modular_inverse([12, 15, 21, 33, 45], 10, 7) == 1
    """
    count = 0
    for i in range(N):
        if gcd(arr[i], P) == 1:
            count += 1
    return count

def gcd(a, b):
    if b == 0:
        return a
    return gcd(b, a % b)
