def count_binary_seq(n):
    """
    Find the count of all binary sequences of length 2n such that sum of first n bits is same as sum of last n bits.
    For example:
    count_binary_seq(2) == 16
    count_binary_seq(1) == 2
    """
    if n == 0:
        return 1
    dp = {}

    def solve(index, sum_so_far):
        if index == n:
            return 1 if sum_so_far == 0 else 0
        if (index, sum_so_far) in dp:
            return dp[(index, sum_so_far)]

        count = 0
        for bit in [0, 1]:
            count += solve(index + 1, sum_so_far + bit)

        dp[(index, sum_so_far)] = count
        return count

    return solve(0, 0)
```

