    """
    Given a positive integer n, find the count of all binary sequences of length 2n such that sum of first n bits is same as sum of last n bits.
    For example:
    count_binary_seq(2) == 7
    count_binary_seq(1) == 2
    """
    if n == 0:
        return 1

    dp = {}

    def solve(idx, sum1, sum2):
        if idx == 2 * n:
            if sum1 == sum2:
                return 1
            else:
                return 0

        if (idx, sum1, sum2) in dp:
            return dp[(idx, sum1, sum2)]

        count = 0
        # Option 1: Set the current bit to 0
        count += solve(idx + 1, sum1, sum2)

        # Option 2: Set the current bit to 1
        if sum1 < n:
            count += solve(idx + 1, sum1 + 1, sum2)
        if sum2 < n:
            count += solve(idx + 1, sum1, sum2 + 1)

        dp[(idx, sum1, sum2)] = count
        return count

    return solve(0, 0, 0)
