def max_sum_rectangular_grid(grid, n):
    """
    Finds the maximum sum such that no two chosen numbers are adjacent for the given rectangular grid of dimension 2 x n.

    Args:
        grid (list of lists): A 2 x n grid represented as a list of lists.
        n (int): The length of the grid.

    Returns:
        int: The maximum sum achievable.
    """
    if n == 0:
        return 0
    elif n == 1:
        return grid[0][0] + grid[1][0]
    elif n == 2:
        return max(grid[0][0] + grid[1][1], grid[0][0] + grid[1][0], grid[0][1] + grid[1][0], grid[0][0] + grid[1][1])
    else:
        include = grid[0][0] + grid[1][0]
        exclude = 0
        for i in range(1, n):
            new_include = exclude + max(grid[0][i] + grid[1][i + 1], grid[0][i] + grid[1][i])
            new_exclude = max(include, exclude)
            include = new_include
            exclude = new_exclude
        return max(include, exclude)
