        if word in word_counts:
            word_counts[word] += 1
        else:
            word_counts[word] = 1

    most_frequent_word = None
    max_count = 0

    for word, count in word_counts.items():
        if count > max_count:
            max_count = count
            most_frequent_word = word

    if most_frequent_word is None:
        return None
    else:
        return most_frequent_word
