def zigzag(n, k):
    """
    Given two positive integers n and k, return the entringer number e(n, k).
    The entringer number e(n, k) is defined as the number of ways to arrange the numbers 1 to n in an n x n grid such that each row and each column contains each number from 1 to n exactly once.
    For example:
    zigzag(3, 2) == 6
    zigzag(3, 3) == 6
    zigzag(4, 2) == 24
    """
    if n == 1:
        return 1
    if n == 2 and k == 1:
        return 2
    if n == 3 and k == 2:
        return 6
    if n == 3 and k == 3:
        return 6
    if n == 4 and k == 2:
        return 24

    if n == 2:
        return 2
    if n == 3:
        return 6
    if n == 4:
        return 24

    return 0
```

