def zigzag(n, k):
    """
    Given two positive integers n and k, return the entringer number e(n, k).
    The entringer number e(n, k) is defined as the number of ways to arrange the digits of n into a k-length sequence such that the sequence is a valid entringer sequence.
    An entringer sequence is a sequence of digits such that each digit is greater than or equal to the digit before it.
    For example, e(123, 2) = 5.
    """
    if k == 1:
        return 1
    if n == 0:
        return 0
    if n == 1:
        return 1
    if k > n:
        return 0

    dp = {}

    def solve(index, prev_digit, remaining_k):
        if remaining_k == 0:
            return 1
        if index == n:
            return 0

        if (index, prev_digit, remaining_k) in dp:
            return dp[(index, prev_digit, remaining_k)]

        count = 0
        for digit in range(1 if index == 0 else 0, n + 1):
            if digit >= prev_digit:
                count += solve(index + 1, digit, remaining_k - 1)

        dp[(index, prev_digit, remaining_k)] = count
        return count

    return solve(0, 0, k)
