def get_carol(n):
    """
    Finds the n'th carol number.
    Carol numbers are numbers that can be expressed as the sum of two consecutive primes.
    For example, the 1st carol number is 4 (2 + 2), the 2nd is 6 (3 + 3), the 3rd is 10 (3 + 7).
    """
    if n <= 0:
        return None

    carol_numbers = []
    num = 4
    while len(carol_numbers) < n:
        is_carol = False
        for i in range(2, num // 2 + 1):
            if is_prime(i) and is_prime(num - i):
                carol_numbers.append(num)
                is_carol = True
                break
        num += 1

    return carol_numbers

def is_prime(n):
    if n <= 1:
        return False
    for i in range(2, int(n**0.5) + 1):
        if n % i == 0:
            return False
    return True
```

