    """
    Given a binary string, find the minimum number of flips required to make the string alternate.
    For example:
    min_flip_to_make_string_alternate("0100") == 2
    min_flip_to_make_string_alternate("10101") == 0
    min_flip_to_make_string_alternate("0000") == 2
    """
    n = len(str)
    count1 = 0
    count2 = 0
    for i in range(n):
        if i % 2 == 0:
            if str[i] == '1':
                count1 += 1
            else:
                count2 += 1
        else:
            if str[i] == '0':
                count1 += 1
            else:
                count2 += 1
    return min(count1, count2)
