    Extract the frequency of unique tuples in the given list order irrespective.
    For example:
    extract_freq([(1, 2), (3, 4), (1, 2), (5, 6), (3, 4)]) == { (1, 2): 2, (3, 4): 2, (5, 6): 1}
    extract_freq([(1, 2), (1, 2), (1, 2)]) == {(1, 2): 3}
    extract_freq([(1, 2), (3, 4), (5, 6)]) == {(1, 2): 1, (3, 4): 1, (5, 6): 1}
    """
    freq = {}
    for tup in test_list:
        if tup in freq:
            freq[tup] += 1
        else:
            freq[tup] = 1
    return freq
```

