def add_nested_tuples(test_tup1, test_tup2):
    """
    Given two nested tuples, perform index wise addition of tuple elements.
    For example:
    add_nested_tuples((1, 2, 3), (4, 5, 6)) == (5, 7, 9)
    add_nested_tuples(((1, 2), (3, 4)), ((5, 6), (7, 8))) == ((6, 8), (10, 12))
    """
    result = []
    for i in range(len(test_tup1)):
        if isinstance(test_tup1[i], tuple) and isinstance(test_tup2[i], tuple):
            result.append(add_nested_tuples(test_tup1[i], test_tup2[i]))
        else:
            result.append(test_tup1[i] + test_tup2[i])
    return tuple(result)
