def extract_rear(test_tuple):
    """Given a tuple of strings, return a tuple containing only the rear element of each string.
    For example:
    extract_rear(("hello", "world", "python")) == ("o", "d", "n")
    extract_rear(("a", "b", "c")) == ("a", "b", "c")
    extract_rear(()) == ()
    """
    result = []
    for s in test_tuple:
        if s:
            result.append(s[-1])
        else:
            result.append("")
    return tuple(result)
