def count_Occurrence(tup, lst):
    """
    Given a tuple and a list, count the occurence of all elements of list in the tuple.
    For example:
    count_Occurrence((1, 2, 3, 1, 2, 1), [1, 2, 3]) == {1: 3, 2: 2, 3: 1}
    count_Occurrence((1, 2, 3), [4, 5, 6]) == {4: 0, 5: 0, 6: 0}
    """
    counts = {}
    for element in lst:
        counts[element] = 0
    for element in tup:
        if element in counts:
            counts[element] += 1
    return counts
