def cal_sum(n):
    """
    Calculate the sum of the first n Perrin numbers.

    Args:
        n: The number of Perrin numbers to sum.

    Returns:
        The sum of the first n Perrin numbers.
    """
    if n <= 0:
        return 0

    perrin = [0, 1, 1]
    if n <= 3:
        return sum(perrin[:n])

    for i in range(3, n):
        next_perrin = perrin[i - 2] + perrin[i - 3]
        perrin.append(next_perrin)

    return sum(perrin)
```

