def sum_gp(a,n,r):
  """
  Given three integers a, n, and r, find the sum of the geometric progression series.
  The formula for the sum of a geometric progression series is:
  S = a * (1 - r^n) / (1 - r) if r != 1
  S = a * n if r == 1
  """
  if r == 1:
    return a * n
  else:
    return a * (1 - r**n) / (1 - r)
