def num_comm_div(x,y):
    """Given two numbers x and y, find the common divisor between them.
    For example:
    num_comm_div(12,18) == 6
    num_comm_div(10,15) == 5
    num_comm_div(7,13) == 1
    """
    divisors_x = []
    for i in range(1,x+1):
        if x % i == 0:
            divisors_x.append(i)
    divisors_y = []
    for i in range(1,y+1):
        if y % i == 0:
            divisors_y.append(i)
    common_divisors = []
    for divisor in divisors_x:
        if divisor in divisors_y:
            common_divisors.append(divisor)
    if not common_divisors:
        return 1
    else:
        return common_divisors[-1]
```

